import React from 'react';

const Contact = () => {
    return (
        <section className="contact section" id="contact">
            <h2 className="section-title">Contact</h2>

            <div className="contact__container bd-grid">
                <form id="contactForm" className="contact__form">
                    <input type="text" id="name" placeholder="Name" className="contact__input" />
                    <input type="email" id="email" placeholder="Email" className="contact__input" />
                    <textarea id="message" cols="30" rows="10" className="contact__input"></textarea>
                    <input type="submit" value="Submit" className="contact__button button" />
                </form>
            </div>
        </section>
    );
};

export default Contact;
